import './App.css';
// import Main from './page/main';
import Formulario from './componentes/formulario.jsx'
import Boton from './componentes/boton';
import Agregados from './componentes/agregados';

function App() {
  return (
    <body>
    <div className="container">

      <form>
      <Formulario />

      <Boton />
      </form>
      <div className="drops">

      <Agregados />
      </div>

    </div>
    </body>
  );
}

export default App;
